!function(){var o={template:'\n    <div class="zoom-component" >\n      \x3c!-- <div class="zoom-cover"></div> --\x3e\n      <div :class="{zoom: scale}" class="img-box" @click.self="close">\n        <img :src="img" @click.self="zoom">\n      </div>\n    </div>\n  ',props:["img"],data:function(){return{scale:!1}},methods:{zoom:function(){this.scale=!this.scale},close:function(){this.$emit("close")}}};Vue.component("zoom-component",o)}();